import React from 'react';

const style = {
    main:{
        display:'flex',
        flexDirection:'center',
        height:'100%',
        width:'100%',
        background:'#ff773b'
    },
    navbar:{
        height:'10%',
        width:'100%'
    },
    section:{
        height:'90%',
        width:'100%'
    }
}

const Layout = () => {
    return (
        <main style={style.main}>
            <section style={style.navbar}>

            </section>
            <section>

            </section>
        </main>
    )
}

export default Layout;
